import {
  Link,
  Route,
  BrowserRouter as Router,
  Switch
} from "react-router-dom";
import React, { Component } from "react"

import Clock from "./Clock"
import Radio from "./Radio"

// const navStyle = {
//   color: "red",
//   backgroundcolor: "black",
// }

class NavBar extends Component {
  render() {
    return (
      <Router>
      <div>
        <nav>
          <a className="navbar-brand" href="/#Clock">
            Clock
          </a>
          <a className="navbar-brand" href="/#Radio">
            Radio
          </a>
        </nav>
        <Clock />
          <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
      </Router>
    )
  }
}

export default NavBar
